class Solution:
    def countDistinct(self, s: str, q: int) -> int:
        # Time: O(n^2)
        # Space: O(n)

        count = 0

        def count_once(s: str, q: int) -> int:
            nonlocal count

            if q == 0:
                count += 1
                return count

            if len(s) == 1:
                return 0

            if q == 1:
                return 0

            if len(s) <= 2:
                return 1

            if q == 2:
                if s[0].lower()!= s[1].lower():
                    return 0
                return 2

            if s[0].lower() == s[1].lower():
                if s[1].lower() == 'b':
                    return count_once(s[2:len(s)], q - 2) + count_once(s[0:len(s) - 2], q - 1)
                else:
                    return count_once(s[1:len(s) - 1], q - 1) + count_once(s[0:len(s) - 1], q - 2)
            else:
                return count_once(s[1:len(s) - 1], q - 1) + count_once(s[1:len(s)], q - 1)

        return count_once(s, q)

