    N = 0
    for i in range(R):
        for j in range(C):
            if m[i][j] == 'X':
                N += 1
            if m[i][j] == '.':
                N += 1
    answer = ''

    if N == 1:
        answer = str(1)
    elif N == 2:
        answer = str(2)
    elif N >= 3:
        answer = str(1) * (N-1) + str(2) * N
        N -= 1
    else:
