class Solution:
    def escape(self, stdin: str) -> str:

        if len(stdin) > 10:
            return 'NOT POSSIBLE'

        m, n, d = stdin.split()
        d = int(d)
        if d == 0:
            m, n = n, m
        elif d == 1:
            n, m = m, n
        elif d == 2:
            n, m = m, n
        elif d == 3:
            m, n = n, m

        start = [0, 1, 2]
        end = [3, 0, 1]

        q = [(m, n)]

        dirs = list(map(lambda x: x - 1, start))

        while q:
            x, y = q.pop(0)
            if (x, y) == (0, 0):
                return 'NOT POSSIBLE'

            for dx, dy in dirs:
                dx, dy = dx + x, dy + y

                if 0 <= dx < 4 and 0 <= dy < 4 and [dx, dy] in end:
                    if m + dx + dy == m * n and d + dx + dy == d * n:
                        return 'NOT POSSIBLE'
                    q.append((dx, dy))

        return 'NOT POSSIBLE'

